import axios from 'axios';
import CardList from 'pages/CardList';
import properties from 'properties';
import React, { useEffect, useState } from 'react'

export const DelhiFlats = () => {
const[fetchdata,setFetchdata]=useState([])
    const flat_type=(e)=>{
        e.preventDefault();
        const allData={propertytype:"Flat/ Apartment",city:"Delhi"};
             console.log(allData);
        fetchData(allData)

        async function fetchData(allData) {
          const searchData = await axios.get(properties.search_url, { params: allData })
          setFetchdata(searchData.data.data);


        }

    }

    useEffect(()=>{
        flat_type()
        e.preventDefault();

    })


    return (
        <>
         <div className="drop-call">
               <div className="drop-heading">Property Types</div>
               <div className="drop-links">
                   <li><a href="" onClick={flat_type}>Flats in New-Delhi</a></li>
                   {/* <li><a href="">House/Villa in New-Delhi</a></li> */}
              </div>
          </div>

               {
                fetchdata.map((property,index)=>{
                    return (
                        <CardList
                        id={property.id}
                        city={property.city}
                        flatprice={property.flat_price}
                        location={property.location}
                        per_square_fit={property.per_square_fit}
                        furnish_status={property.furnished_status}
                        images={property.property_images}
                        reason={property.reason}
                        type={property.type}

                        />

                )})
            }

         </>
    )
}
